import site1 from "../images/sites/site1.jpg";
import site2 from "../images/sites/site2.jpg";
import site3 from "../images/sites/site3.png";
import site4 from "../images/sites/site4.png";
import site5 from "../images/sites/site5.jpg";
import site6 from "../images/sites/site6.jpg";
import Site from "../components/Site";
import Container from "react-bootstrap/Container";

function Portfolio(props) {
  return (
    <Container>
      <ul className="Portfolio-sites">
        {props.sites.map(site => (
          <Site site={site} />
          //   <li key={site}>
          //     <a href="http://localhost:8888/Beauty/" target="_blank">
          //       {site.name}
          //       <img src={site.img} alt="" />
          //     </a>
          //   </li>
        ))}
        <style jsx>{`
          .Portfolio-sites {
            list-style-type: none;
            display: flex;
            flex-wrap: wrap;
            //   max-width: 900px;
            justify-content: center;
            margin: 60px auto 0px;
            padding: 40px;
            font-size: 1.5rem;
          }
          li {
            flex-basis: 33%;
            padding: 20px 0px;
          }

          li a {
            color: #000;
            text-decoration: none;
          }
        `}</style>
      </ul>
    </Container>
  );
}

Portfolio.defaultProps = {
  sites: [
    { name: "Beauty Site", img: site1, link: "http://localhost:8888/Beauty/" },
    {
      name: "Cosmetics Site",
      img: site2,
      link: "http://localhost:8888/Beauty/"
    },
    {
      name: "Restaurant Site",
      img: site3,
      link: "http://localhost:8888/Beauty/"
    },
    { name: "Sports Site", img: site4, link: "http://localhost:8888/Beauty/" },
    { name: "Music Site", img: site5, link: "http://localhost:8888/Beauty/" },
    { name: "Legal Site", img: site6, link: "http://localhost:8888/Beauty/" }
  ]
};

export default Portfolio;
